import React from 'react';
import { Outlet, Link } from 'react-router-dom'
import './App.css'

function App() {
  return (
    <div>
      <header>
        <div>
          <h1>SebMedia</h1>
        </div>
        <div>
          <Link to="home">
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/3/34/Home-icon.svg/2048px-Home-icon.svg.png" alt="Home"/>
          </Link>
          <Link to="dashboard">Dashboard</Link>
          <Link to="posts">Posts</Link>
        </div>
      </header>
      <Outlet/>
    </div>
  );
}

export default App;
